import axios from './Interceptor';

class AuthServices {
    login(user,data) { 
        return axios.post(`auth/login?user`,data)
    }
    otp(data){  
        return axios.post("/signup/otp",data)
      }
      otpResend(data){ 
        return axios.post('/signup/otp-resend',data)
    }
}

export default new AuthServices();
